import React, { Component } from 'react'; 
import Projects from './project.json'; 
import Footer from './Footer';

class Portfolio extends Component {

    render() {
        const ProjectData = Projects.map(
            (project) => {
                return (
                    <>
                    <div className="row">
                        <h3>{project.name}</h3><br></br>
                        <p>{project.description}</p>
                        <div className="row">  
                            <div className="col-sm-6">
                                <img class='cropped' src={project.images} width='100%' alt="Campaignion Input"/><br></br><br></br>
                            </div>
                            <div className="col-sm-6">
                                {/* <img class='cropped' src={project.images[1]} width='100%'alt="Campaignion Output"/><br></br><br></br> */}
                            </div>
                        </div>    
                        <p>{project.tools}</p>
                    </div>

                    <br></br><br></br>
                    <p>• • • • • • •</p>
                    <br></br><br></br>
                    </>
                )
            }
        )
        return (
            <div>
                <div className="content-container portfolio"> 
                    {ProjectData}
                </div>
                <Footer></Footer>
            </div>
        )
    }
}

export default Portfolio;
